import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header_main from './components/Header_main';
import Navbar from './components/Navbar';
import Main_page from './components/MAIN/Main_page';
import Profil_page from './components/PROFIL/Profil_page';
import Myblog_page from './components/MYBLOGE/Myblog_page';
import Blogers_page from './components/BLOGERS/Blogers_page';

function App() {
  return (
    <Router>
      <div>
        <Header_main />
        <main className='Main'>
          <aside>
            <Navbar />
          </aside>
          <div className="content">
            <Switch>
              <Route path="/" exact component={Main_page} />
              <Route path="/profil" component={Profil_page} />
              <Route path="/myblog" component={Myblog_page} />
              <Route path="/blogers" component={Blogers_page} />
            </Switch>
          </div>
        </main>
      </div>
    </Router>
  );
}

export default App;
